import React from 'react';

export default function About() {
  return (
    <div className="about">
      <h1>About Me</h1>
      <p>I'm a developer who loves building clean interfaces and useful web apps.</p>
      <p>Replace this text with your own bio, experience, education, and links.</p>
    </div>
  );
}
